import BaseCache from "./BaseCache";
import cache from "../CacheUtils";

export default class extends BaseCache {
    constructor(url) {
        super(url, "dictionary");
    }

    /**
     * 缓存字典数据
     * @param data
     */
    cacheData(data) {
        for (let key in data) {
            cache.push(this.name + "-" + key, data[key])
        }
    }


};
